// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;


import "openzeppelin-contracts/contracts/token/ERC721/ERC721.sol";
import "openzeppelin-contracts/contracts/access/Ownable.sol";

contract PictureToken is ERC721, Ownable {

    string image;
    uint256 public price;
    bool onSale;

    constructor(address initialOwner, string memory _image)
    ERC721("PictureToken", "PT")
    Ownable(initialOwner)
    {
        image = _image;
        price = 0;
        onSale = false;
    }

    function _baseURI() internal pure override returns (string memory) {
        return "ipfs://pieceTokenBaseURI";
    }

    function getSinglePictureToken() public view returns(tokenData memory) {
        return tokenData(Ownable.owner(), image, price, onSale);
    }

    function getPrice() public view returns(uint256) {
        return price;
    }

    function setPrice(uint256 _price) public onlyOwner {
        price = _price;
    }

    function putOnSale() public onlyOwner {
        onSale = true;
    }

    function notPutOnSale() public onlyOwner {
        onSale = false;
    }

    function purchase() public {
        payable(msg.sender).transfer(price);
        transferOwnership(msg.sender);
        price = 0;
        onSale = false;
    }

}

struct tokenData {
    address ownerAddress;
    string image;
    uint256 price;
    bool onSale;
}

